import React from 'react';
import './Main.css';

const Main = () => (
    <main>
        <div className="container">
            <div className="block-form">
                <h2>Cadastro</h2>

                <span>Seu nome</span>
                <input type="text" className="form-control" placeholder="Digite aqui seu nome" />

                <span>Seu email</span>
                <input type="text" className="form-control" placeholder="Digite aqui seu email" />
            </div>
        </div>
    </main>
);

export default Main;
